import { useState } from "react"
import resto from "../MockData/data"
const Filters=()=>{
    return <div>
        <div>
            <button>above 4</button>
            <button>cost less than 300</button>
            <button>cost between 300 and 500</button>
        </div>
        <div>
            <input type="text" placeholder="type your dish"></input>
            <button></button>
        </div>
    </div>
}
const Card=(props)=>{
    return <div className="card">
           <img src="https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/x4uyxvihmg8qa3pddkgf"></img>
           <h3>{props.jhc.name}</h3>
           <p>{props.jhc.ratings} ratings</p>
           <p>{props.jhc.location}</p>
           <p>{props.jhc.deliveryTime} min</p>
    </div>
}

const CardFlex=()=>{
    const [data,setData]=useState(resto)
    return <div className="card-flex">
       {
         data.map((x)=>{
            return <Card jhc={x}/>
         })
       } 
    </div>
}

const Middle=()=>{



    return <div className="middle">

       <CardFlex/>
    </div>
}


export default Middle
